pub enum MouseButton {

    /// Unknown mouse button.
    Unknown,

    /// Left mouse button.
    Left,

    /// Right mouse button.
    Right,

    /// Middle mouse button.
    Middle,

    /// Extra mouse button number 1.
    X1,

    /// Extra mouse button number 2.
    X2,

    /// Mouse button number 6.
    Button6,

    /// Mouse button number 7.
    Button7,

    /// Mouse button number 8.
    Button8,
}

pub enum ButtonState {

    /// Button was pressed.
    Press,

    /// Button was released.
    Release,
}

pub enum Touch {

    /// The start of touch, for example
    /// a finger pressed down on a touch screen.
    Start,

    /// The move of touch, for example
    /// a finger moving while touching a touch screen.
    Move,

    /// The end of touch, for example
    /// taking a finger away from a touch screen.
    End,

    /// The cancel of touch, for example
    /// the window loses focus.
    Cancel,
}

pub enum Button {

    /// A keyboard button.
    Keyboard(Key),

    /// A mouse button.
    Mouse(MouseButton),

    /// A controller button.
    Controller(ControllerButton),

    /// A controller hat (d-Pad)
    Hat(ControllerHat),
}

pub enum Motion {

    /// Position in window coordinates.
    MouseCursor([f64; ]),

    /// Position in relative coordinates.
    MouseRelative([f64; ]),

    /// Position in scroll ticks.
    MouseScroll([f64; ]),

    /// Controller axis move event.
    ControllerAxis(ControllerAxisArgs),

    /// Touch event.
    Touch(TouchArgs),
}

pub enum HatState {

    /// Centered (no direction).
    Centered,

    /// Up direction.
    Up,

    /// Right direction.
    Right,

    /// Down direction.
    Down,

    /// Left direction.
    Left,

    /// Right-up direction.
    RightUp,

    /// Right-down direction.
    RightDown,

    /// Left-up direction.
    LeftUp,

    /// Left-down direction.
    LeftDown,
}

pub enum FileDrag {

    /// A file is being hovered over the window.
    Hover(PathBuf),

    /// A file has been dropped into the window.
    Drop(PathBuf),

    /// A file was hovered, but has exited the window.
    Cancel,
}

pub enum Input {

    /// Changed button state.
    Button(ButtonArgs),

    /// Moved mouse cursor.
    Move(Motion),

    /// Text (usually from keyboard).
    Text(String),

    /// Window got resized.
    Resize(ResizeArgs),

    /// Window gained or lost focus.
    Focus(bool),

    /// Window gained or lost cursor.
    Cursor(bool),

    /// A file is being dragged or dropped over the window.
    FileDrag(FileDrag),

    /// Window closed.
    Close(CloseArgs),
}

pub enum Loop {

    /// Render graphics.
    Render(RenderArgs),

    /// After rendering and swapping buffers.
    AfterRender(AfterRenderArgs),

    /// Update the state of the application.
    Update(UpdateArgs),

    /// Do background tasks that can be done incrementally.
    Idle(IdleArgs),
}

pub enum Event {

    /// Input events.
    ///
    /// Time stamp is ignored when comparing input events for equality and order.
    Input(Input, Option<TimeStamp>),

    /// Events that commonly used by event loops.
    Loop(Loop),

    /// Custom event.
    ///
    /// When comparing two custom events for equality,
    /// they always return `false`.
    ///
    /// When comparing partial order of two custom events,
    /// the event ids are checked and if they are equal it returns `None`.
    ///
    /// Time stamp is ignored both when comparing custom events for equality and order.
    Custom(EventId, Arc<Any + Send + Sync>, Option<TimeStamp>),
}
